page_script({init:function(){$(".map-canvas").each(function(){var b=new google.maps.LatLng($(this).attr("data-latitude"),$(this).attr("data-longitude"));var c={scrollwheel:false,zoom:13,center:b};var d=new google.maps.Map($(this)[0],c);var a=new google.maps.Marker({position:b});a.setMap(d)});window.fbAsyncInit()}});